import fs from 'fs';
import path from 'path';
import { exec } from 'child_process';
import util from 'util';
import sharp from 'sharp';
import { fileURLToPath } from 'url';

// Convert exec to Promise
const execPromise = util.promisify(exec);

// Get the directory name
const __filename = fileURLToPath(import.meta.url);
const __dirname = path.dirname(__filename);

/**
 * Process Aadhaar PDF: Decrypt, convert to image, crop, and return as base64
 * @param {string} base64Pdf - Base64 encoded PDF string
 * @param {string} pdfPassword - Password to decrypt the PDF
 * @param {Object} cropConfig - Configuration for cropping (x, y, width, height)
 * @returns {Promise<string>} - Base64 encoded JPEG image
 */
export const processAadhaarPdf = async (
  base64Pdf,
  pdfPassword,
  cropConfig = { x: 800, y: 800, width: 1000, height: 1000 }
) => {
  try {
    // Create temp directory if it doesn't exist
    const tempDir = path.join(__dirname, 'temp');
    if (!fs.existsSync(tempDir)) {
      fs.mkdirSync(tempDir, { recursive: true });
    }

    // Decode base64 to buffer and save as PDF file
    const pdfBuffer = Buffer.from(base64Pdf, 'base64');
    const timestamp = Date.now();
    const pdfPath = path.join(tempDir, `encrypted-${timestamp}.pdf`);
    fs.writeFileSync(pdfPath, pdfBuffer);
    console.log(`PDF saved to ${pdfPath}`);

    // Output image path
    const outputImagePrefix = path.join(tempDir, `aadhaar-page-${timestamp}`);

    // Use pdftoppm to convert PDF to image with password
    const command = `pdftoppm -f 1 -l 1 -png -r 300 -upw "${pdfPassword}" "${pdfPath}" "${outputImagePrefix}"`;
    console.log(`Executing command: ${command}`);

    await execPromise(command);

    // The output file will be named with -1 suffix for the first page
    const imagePath = `${outputImagePrefix}-1.png`;
    console.log(`PDF converted to image at ${imagePath}`);

    // Check if the output file exists
    if (!fs.existsSync(imagePath)) {
      throw new Error('Failed to convert PDF to image. Output file not found.');
    }

    // Read the image
    const imageBuffer = fs.readFileSync(imagePath);

    // Crop the image using sharp
    const croppedImageBuffer = await sharp(imageBuffer)
      .extract({
        left: cropConfig.x,
        top: cropConfig.y,
        width: cropConfig.width,
        height: cropConfig.height,
      })
      .jpeg({ quality: 90 })
      .toBuffer();

    // Convert to base64
    const base64Image = croppedImageBuffer.toString('base64');

    // Clean up temp files
    try {
      fs.unlinkSync(imagePath);
      fs.unlinkSync(pdfPath);
      console.log('Temporary files cleaned up successfully');
    } catch (error) {
      console.error('Error cleaning up temporary files:', error);
    }

    return base64Image;
  } catch (error) {
    console.error('Error processing Aadhaar PDF:', error);
    throw new Error(`Failed to process Aadhaar PDF: ${error.message}`);
  }
};

